import React from 'react'
import {FcSimCard} from 'react-icons/fc'
const Logo = () => {
  return (
    <div className='logo'>
      <div className="logo icon" style={{transform: 'rotate(25deg)'}}>
        <FcSimCard />
      </div>
    </div>
  )
}

export default Logo
